import "./App.css";
import Navbar from "./navbar.js";

function Contact() {
  return (
    <div>
      <header>
        <Navbar />
      </header>
      <body>
        <div id="contactSect">
          <h3>FAQs</h3>
          <div className="question">
            <h6>How do I take care of my Fluff Stuff pillow?</h6>
            <p>
              Your Fluff Stuff pillow is designed for longevity. Still, there
              are certain things you can do to make it as soft and luxurious for
              as long as possible. Make sure to handwash it in warm water, and
              hang it to dry. Never dry clean it or use bleach.
            </p>
          </div>
        </div>
      </body>
    </div>
  );
}

export default Contact;
